import React from 'react';
import '../css/Dashboard.css';

const PlayerDashboard = ({ initialData, onLogout }) => {
  const training = initialData.trainingPlan || {};
  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>专 砖  <small>{initialData.userId?.fullName}</small></h1>
        <button onClick={onLogout} className="btn-logout">爪</button>
      </div>
      <div className="content-box">
        <h3>转转 </h3>
        <div className="stat-card">拽注转: {training.shooting || 0}</div>
        <div className="stat-card">砖专: {training.fitness || 0}</div>
      </div>
    </div>
  );
};
export default PlayerDashboard;
